"original": |2-
        Note: The type1 or type2 prefix on the basic attribute syntax is
        provided only to communicate the IANA policy required for
        registration and is not represented in IPP messages.  Both type1
        and type2 enum values are represented using the same enum
        value tag.
"fixed": |-
  - Note: The type1 or type2 prefix on the basic attribute syntax is provided only to communicate the IANA policy required for registration and is not represented in IPP messages.  Both type1 and type2 enum values are represented using the same enum value tag.
"ko": |-
  - 참고: 기본 속성 구문의 type1 또는 type2 접두사는 등록에 필요한 IANA 정책을 전달하기 위해서만 제공되며 IPP 메시지에는 표시되지 않습니다. type1 및 type2 열거형 값은 모두 동일한 열거형 값 태그를 사용하여 표시됩니다.
